function globalInit(){mapInit("map-canvas"),startMarkers(),initPage()}function initPage(){$(window).on("load resize",function(){$(".map-tab-content").height($("#tab-content").height()-$(".page-title-1").height()-4.2*$("#map-overlay-global-controls").height())})}function initMarkers(e){e?createMarker(!1,!0,new MarkerObject("@DEBUG@@Locator",new Coordinates(0,500,0),MarkerTypes.debug,"",""),""):createMarker(!1,!1,new MarkerObject("True Map Center",new Coordinates(0,0,0),MarkerTypes.normal,"",""),"")}